import { Eventcalendar, getJson, toast } from '@mobiscroll/react';

export const App = () => {

    const [events, setEvents] = React.useState([]);

    const onPageLoading = React.useCallback((event, inst) => {
        const year = event.month.getFullYear();
        const month = event.month.getMonth();

        getJson('https://trial.mobiscroll.com/monthlyevents/?year=' + year + '&month=' + month + '&vers=5', (data) => {
            const newEvents = [];

            for (const value of data) {
                newEvents.push({
                    start: value.start,
                    end: value.end || '',
                    allDay: value.allDay,
                    title: value.title,
                    color: value.color
                });
            }

            setEvents(newEvents);

            toast({                message: 'New events loaded'
            });

        }, 'jsonp');
    }, []);

    const view = React.useMemo(() => {
        return {
            calendar: { labels: true }
        };
    }, []);

    return (
        <Eventcalendar
            theme="ios" 
            themeVariant="light"
            clickToCreate={false}
            dragToCreate={false}
            dragToMove={false}
            dragToResize={false}
            eventDelete={false}
            data={events}
            view={view}
            onPageLoading={onPageLoading}
       />
    ); 
}
